/**
 * Here you can change the event before it is sent using also the state accumulated so far.
 * @param state {Object} state structure, contains at least field session; you can add to it to propagate state from test step to test step
 * @param event {Object} the event to be sent.
 * @return {Object} the event to be sent
 */
function pre_process(state,event){
  // it does nothing, it is up to you to add some meaningful actions; most likely you want to change the event before being sent
  // the application adds session field to event automatically, you don't need to add it
  return event;
}

/**
 * it is used to implement checks to declare if step was successful or not
 * @param state {Object} state structure, contains at least field session
 * @param event {Object} the event received
 * @return {Boolean} true if step is to be declared successful
 */
function validate(state,event){
  // it does nothing for now, add your own validation; you have access to state as it was populated from previous steps
  return true;
}
